//
// 通常パターン取得
//
//  Call
//    size : 大きさ
//
//  Return
//    funtion : パターン
//
+(const unsigned char *)normal:(int)size
{
    (size)--;
    if (size < 0) {
        size = 0;
    } else if (size > 15) {
        size = 15;
    }

    return &(__atomizerNormal[size][0]);
}


//
// 半値パターン取得
//
//  Call
//    size : 大きさ
//    num  : 種別(0 or 1)
//
//  Return
//    funtion : パターン
//
+(const unsigned char *)half:(int)size type:(int)num
{
    (size)--;
    if (size < 0) {
        size = 0;
    } else if (size > 15) {
        size = 15;
    }

    return ((num == 0) ? &(__atomizerHalf0[size][0]) :
                         &(__atomizerHalf1[size][0]));
}

